import React from 'react'
import {Layout } from 'antd'

const {Footer} = Layout

const FooterPage: React.FC = () => {
    return (
            <Footer style={{ textAlign: 'center', fontFamily: 'Mark Pro' }}>
                © MasterSeats • Made with ♥️ in Ann Arbor
            </Footer>
        )
}

export default FooterPage
